  input: TEXT,"F3XA","","This amendment is in response to the Commission's  letter
    dated November 10, 2005.   The Committee transferred the excess portion of the
    contribution from HOPEFUND, Inc to its Non-Federal Account on December 13, 2005.  The
    transfers to the Committee's Non-Federal Account were for cash flow purposes and
    no allocable expenses were paid from this Account.  Disbursements for 'Cell Phone
    Reimbursement' were stipends for cell phone expenses and are paid to the individuals
    on a predetermined scale.  These payments are not reimbursements for a specific
    payment to a vendor.  The Commission has requested and the Committee has supplied
    all but one of the itemizations for 'Travel Reimbursement' and 'Office Supply
    Reimbursement.'   However, this one disbursement is still in the process of being
    located.  Given that the Coordinated Campaign is temporary, the physical files
    are in the process of being moved to a new location.  The Committee will file
    amendments to itemize the reimbursements on Scheudle H4 when the records have
    been received.  Payments reported on the Committee's Schedule H4 for 'Voter File
    List' and 'Concealed Permit Voter File Lists' - after careful review of the definition
    of Voter Identification and other federal election activities, we have determined
    that these reported activities do not meet any of those definitions."
